import { useEffect, useState } from 'react';

function App() {

  const [commands, setCommands] = useState(null)

  // useEffect( , [])

  const fetchData = () => {

    fetch("http://localhost:5000/api/command/all", {method: "GET"})
    .then(res => res.json())
    .then( res => setCommands(res))
  }

  const Command = (command) => (
    <div> 
     <ul>
       <li>Cocina: {command.kitchen}</li>
       <li>Fecha: {command.date}</li>
       <li>Hora: {command.time}</li>
       <li>Mozo: {command.waiter}</li>
       <li>Mesa: {command.table}</li>
      {JSON.stringify(command.command)}
     </ul>
    </div>
  )  

  return (
    <div className="App">
      <h1>hola</h1>
      {commands ? commands.map(command => <Command command={command}/>) : <></>}
      <button onClick={fetchData} >Fetch</button>
    </div>
  );
}

export default App;
